script: |
  super -f text -I q4192.spq | sort > q4192.out

inputs:
  - name: q4192.spq
    data: |
      SELECT DISTINCT - col2 AS col0 FROM tab2 (FORMAT parquet) cor0 WHERE NOT col2 + + - col0 BETWEEN - CAST ( NULL AS INTEGER ) + col1 AND - col1;
  - name: tab2

outputs:
  - name: q4192.out
    data: |
      -23
      -40
      -58
